ance. The reporting of copy number variants less than 100 kb in size is at the discretion of the laboratory and some clinically relevant copy number changes under 50 kb may not be reported due to limitations in probe coverage in certain genomic regions. Copy number changes of any size with no apparent clinical significance (likely benign or benign) have not been discussed in this report but may be available upon request. Regions of homozygosity (ROH) less than 10 Mb in size will not be reported unless the ROH is clinically relevant for potential uniparental disomy. Genome-wide ROH under 2% will not be reported. Copy number variants less than 200 kb associated with a carrier status for autosomal recessive conditions will not be reported unless specifically indicated in the reason for referral. This microarray was designed and manufactured by Affymetrix for the sole purpose of identifying DNA copy number gains and losses associated with chromosomal imbalances and regions of homozygosity (ROH) associated with uniparental isodisomy (isoUPD).This microarray will detect aneuploidy, deletions and duplications of loci represented on the microarray. \u00a0It will not detect balanced alterations including: reciprocal translocations, inversions and balanced insertions. It will not detect point mutations and imbalances less than 10 kb. \u00a0Failure to detect an alteration at any locus does not exclude the diagnosis of any of the disorders represented on the microarray. This assay is not designed to detect mosaic gains and losses and its performance in detecting mosaicism has not been established. This test was developed and its performance characteristics determined by Affymetrix as required by CLIA \u00c2\u201988 regulations. This test is used for clinical purposes and the accuracy and precision has been established and verified by this laboratory. This test has not been cleared or approved by the U.S. Food and Drug Administration. Interpretation of copy number variants is performed using VUMC-laboratory maintained databases as well as the following resources: Database of Genomic Variants (http://dgv.tcag.ca/dgv/app/home) Online Mendelian Inheritance in Man (http://www.omim.org/) UCSC Genome Bioinformatics (http://genome.ucsc.edu/cgi-bin/hgGateway) ClinGen Clinical Genome Resource (http://www.ncbi.nlm.nih.gov/projects/dbvar/clingen) DECIPHER Database (https://decipher.sanger.ac.uk/browser) PubMed-NCBI (http://www.ncbi.nlm.nih.gov/pubmed) Technical standards for the interpretation and reporting of constitutional copy-number variants: a joint consensus recommendation of the American College of Medical Genetics and Genomics (ACMG) and the Clinical Genome Resource (ClinGen). PMID: 31690835 Method: Microarray platform: ThermoFisher Scientific CytoScanTM HD Cytogenetics Solution Version: 1.1 (Based on UCSC hg19 assembly) Number of loci analyzed: 2,696,550 Mean probe spacing: <700 bp Testing performed at Vanderbilt Cytogenetics One Hundred Oaks Laboratory, Suite 21100, 719 Thompson Ln, Nashville, TN 37204 \u00a0phone 615-875-0228, fax 615-875-0234 <br></paragraph></td></tr></tbody></table><table><thead><tr><th>Resulting Agency Comment</th></tr></thead><tbody><tr><td><paragraph data-id=''Result.1.2.840.114350.1.13.478.3.7.2.798268.2061347.ResultingAgencyComment''>testing comment</paragraph></td></tr></tbody></table><table><thead><tr><th>Authorizing Provider</th><th>Result Type</th></tr></thead><tbody><tr><td>Carda Testprovqa MD</td><td>LAB GENETIC TESTING</td></tr></tbody></table><table><thead><tr><th>Performing Organization</th><th>Address</th><th>City/State/ZIP Code</th><th>Phone Number</th></tr></thead><tbody><tr><td data-id=''Result.1.2.840.114350.1.13.478.3.7.2.798268.2061347.PerformingLab''><paragraph>VUMC CERNER LAB</paragraph></td><td><paragraph>4605 TVC VUMC</paragraph><paragraph>1301 Medical Center Drive</paragraph></td><td><paragraph>NASHVILLE, TN 37232-5310</paragraph></td><td><paragraph>615-875-5227</paragraph></td></tr></tbody></table></li><li data-id=''Result.1.2.840.114350.1.13.478.3.7.2.798268.2061345''><caption data-id=''Result.1.2.840.114350.1.13.478.3.7.2.798268.2061345.Procedure''>Pharmacogenomics (03/31/2022 5:36 PM CDT)</caption><table><thead><tr><th>Specimen (Source)</th><th>Anatomical Location / Laterality</th><th>Collection Method / Volume</th><th>Collection Time</th><th>Received Time</th></tr></thead><tbody><tr><td data-id=''Result.1.2.840.114350.1.13.478.3.7.2.798268.2061345.Specimen''>DNA</td><td></td><td></td><td>03/31/2022 5:36 PM CDT</td><td>03/31/2022 5:44 PM CDT</td></tr></tbody></table><table><thead><tr><th>Narrative</th></tr></thead><tbody><tr><td><paragraph>VUMC CERNER LAB - 03/31/2022 5:51 PM CDT</paragraph><paragraph data-id=''Result.1.2.840.114350.1.13.478.3.7.2.798268.2061345.Narrative''>Pharmacogenomics: Final Report Request #: MD-22-0000041 Service Date: 3/31/2022 17:36 Reason for Request: Genotyping for Determination of Drug Efficacy, Dosage and Safety Type of Specimen: DNA Date Received: 3/31/2022 17:44 Date Reported: 3/31/2022 17:51 Interpretation: Results from this assay may indicate dosage adjustments or medication alternatives that should be considered for this patient. Additional information regarding the implications of these results is available at www.mydruggenome.org. For VUMC patients, clinical decision support regarding the management of this patient with respect to specific drugs based upon the patient''s genotype as listed below is available in the patient''s electronic medical record under Genomic Indicators. Clinical decision support may also be provided for some drugs through order entry and medication prescribing tools utilized within the VUMC system. Comments: Results: CYP2C19 - \u00a0Cancelled CYP2C9 - \u00a0 Cancelled CYP2D6 - \u00a0 Cancelled CYP3A5 - \u00a0 Cancelled CYP4F2 - \u00a0 Cancelled DPYD - \u00a0 \u00a0 Cancelled NUDT15 - \u00a0 Cancelled SLCO1B1 - \u00a0Cancelled TPMT - \u00a0 \u00a0 Cancelled VKORC1 - \u00a0 Cancelled These results should be correlated with other laboratory and clinical findings and additional testing should be considered if clinically indicated. Methodology: DNA was extracted from this specimen and screened for 37 variants in 10 genes that are associated with drug absorption, distribution, metabolism, excretion or response. The reported genotypes were determined using PCR amplification and oligonucleotide primers specific for each interrogated region of the genes listed within this panel. Fluorophore labeled probes were used to identify each variant. Variants analyzed in this assay include: CYP2C19 *2, *3, *4, *6, *8, *17; CYP2C9 *2, *3, *6, *8; CYP3A5 *3, *6, *7; CYP4F2 *3; DPYD *2A, *13, c.557A>G, c.1236G>A (HapB3), c.2846A>T; \u00a0NUDT15 *2 or *3; SLCO1B1 *5; TPMT *2, *3B, *3C, *4; VKORC1 promoter variant c.-1639G>A; and CYP2D6 copy number and variants *2, *2A, *3, *4, *6, *7, *9, *10, *17, *29 and *41. A *1 allele is considered the reference (normal) sequence and is reported if none of the variants analyzed for a particular gene is detected. This assay is specific for the variants listed above and cannot exclude the presence of other variants within these genes that may affect the pharmacologic function of the protein product encoded by these genes. In most cases, variants for a particular gene exist on separate alleles; however, for individuals in which multiple variants in the same gene are detected, this assay cannot determine if the variants are on the same allele or on different alleles. Further, due to the highly polymorphic nature of these regions, rare variants may exist that could affect the sensitivity or specificity of this assay and lead to a false-negative or a false-positive result. Electronically signed out by: Barba, Elizabeth on 03/31/2022 This assay has not been cleared or approved by the US Food and Drug Administration. The performance of this assay was tested and validated prior to use for patient testing. This test is used for clinical purposes 